import React from "react";

class Home extends React.Component {
  constructor() {
    super();
    this.state = {
      articles: null,
    };
  }
  componentDidMount() {
    fetch("https://mighty-oasis-08080.herokuapp.com/api/articles")
      .then((res) => res.json())
      .then((data) => {
        this.setState({
          articles: data,
        });
      })
      .catch((err) => console.log(err));
  }
  render() {
    return <div></div>;
  }
}

export default Home;
